/* qpsol:(h[1214x1214,32nz],g[1214],a[1510x1214,3935nz],lba[1510],uba[1510],lbx[1214],ubx[1214],x0[1214],lam_x0[1214],lam_a0[1510],q[],p[])->(x[1214],cost,lam_a[1510],lam_x[1214]) */
static int casadi_f11(const casadi_real** arg, casadi_real** res, casadi_int* iw, casadi_real* w, int mem) {
  OSQPWorkspace *work=casadi_f11_mem[mem];
  casadi_int i, n, offset;
  /* Set objective */
  if (arg[1]) {
    casadi_copy(arg[1], 1214, w);
  } else {
    casadi_clear(w, 1214);
  }
  if (osqp_update_lin_cost(work, w)) return 1;
  /* Set bounds */
  if (arg[5]) {
    casadi_copy(arg[5], 1214, w);
  } else {
    casadi_fill(w, 1214, -casadi_inf);
  }
  if (arg[3]) {
    casadi_copy(arg[3], 1510, w+1214);
  } else {
    casadi_fill(w+1214, 1510, -casadi_inf);
  }
  if (arg[6]) {
    casadi_copy(arg[6], 1214, w+2724);
  } else {
    casadi_fill(w+2724, 1214, casadi_inf);
  }
  if (arg[4]) {
    casadi_copy(arg[4], 1510, w+3938);
  } else {
    casadi_fill(w+3938, 1510, casadi_inf);
  }
  if (osqp_update_bounds(work, w, w+2724)) return 1;
  /* Project Hessian */
  casadi_tri_project(arg[0], casadi_s19, w, 0);/* Get constraint matrix */
  offset = 0;
  for (i=0; i< 1214; ++i) {
    w[26+offset] = 1;
    offset++;
    n = casadi_s25[i+1]-casadi_s25[i];
    casadi_copy(arg[2]+casadi_s25[i], n, w+offset+26);
    offset+= n;
  }
  /* Pass Hessian and constraint matrices */
  if (osqp_update_P_A(work, w, 0, 26, w+26, 0, 5149)) return 1;
  if (osqp_warm_start_x(work, arg[7])) return 1;
  if (arg[8]) {
    casadi_copy(arg[8], 1214, w);
  } else {
    casadi_clear(w, 1214);
  }
  if (arg[9]) {
    casadi_copy(arg[9], 1510, w+1214);
  } else {
    casadi_clear(w+1214, 1510);
  }
  if (osqp_warm_start_y(work, w)) return 1;
  if (osqp_solve(work)) return 1;
  if (res[1]) casadi_copy(&work->info->obj_val, 1, res[1]);
  if (res[0]) casadi_copy(work->solution->x, 1214, res[0]);
  if (res[3]) casadi_copy(work->solution->y, 1214, res[3]);
  if (res[2]) casadi_copy(work->solution->y+1214, 1510, res[2]);
  if (work->info->status_val != OSQP_SOLVED) return 1;
  return 0;
}

