  const casadi_real **m_arg=arg+8, *m_p=arg[1], one=1;
  struct casadi_nlpsol_data d_nlp;
  struct casadi_nlpsol_prob p_nlp;
  struct casadi_sqpmethod_data d;
  struct casadi_sqpmethod_prob p;
  d_nlp.prob = &p_nlp;
  p_nlp.nx = 1214;
  p_nlp.ng = 1510;
  p_nlp.np = 11;
  casadi_nlpsol_init(&d_nlp, &iw, &w);
  if (arg[0]) {
    casadi_copy(arg[0], 1214, d_nlp.z);
  } else {
    casadi_clear(d_nlp.z, 1214);
  }
  if (arg[6]) {
    casadi_copy(arg[6], 1214, d_nlp.lam);
  } else {
    casadi_clear(d_nlp.lam, 1214);
  }
  if (arg[7]) {
    casadi_copy(arg[7], 1510, d_nlp.lam+1214);
  } else {
    casadi_clear(d_nlp.lam+1214, 1510);
  }
